import{_ as o,c as t,o as n,ae as a}from"./chunks/framework.DKf8Joaa.js";const c=JSON.parse('{"title":"Troubleshooting","description":"","frontmatter":{},"headers":[],"relativePath":"docs/troubleshooting.md","filePath":"docs/troubleshooting.md"}'),i={name:"docs/troubleshooting.md"};function s(r,e,l,u,g,h){return n(),t("div",null,[...e[0]||(e[0]=[a('<h1 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h1><p>Common issues and fixes for Vault Intelligence.</p><h2 id="api-connection-issues" tabindex="-1">API &amp; Connection Issues <a class="header-anchor" href="#api-connection-issues" aria-label="Permalink to &quot;API &amp; Connection Issues&quot;">​</a></h2><h3 id="_429-too-many-requests" tabindex="-1">&quot;429 Too Many Requests&quot; <a class="header-anchor" href="#_429-too-many-requests" aria-label="Permalink to &quot;&quot;429 Too Many Requests&quot;&quot;">​</a></h3><p>This means you are hitting Google&#39;s rate limit (Tokens Per Minute or Requests Per Minute).</p><ul><li><strong>Cause:</strong> Often happens during the initial vault index if you have many notes, or if your <strong>Context Window Budget</strong> is set very high (sending 1M tokens at once).</li><li><strong>Fix 1:</strong> Go to <strong>Settings &gt; Indexing &amp; Search</strong> and increase the <strong>Indexing delay</strong> to <code>1000ms</code> or higher.</li><li><strong>Fix 2:</strong> Lower your <strong>Context window budget</strong> to <code>100,000</code> tokens.</li></ul><h3 id="model-not-found" tabindex="-1">&quot;Model not found&quot; <a class="header-anchor" href="#model-not-found" aria-label="Permalink to &quot;&quot;Model not found&quot;&quot;">​</a></h3><ul><li><strong>Cause:</strong> You might be trying to use a newer model (like <code>gemini-3-flash-preview</code>) that hasn&#39;t rolled out to your API key&#39;s region yet, or you have a typo in the model name.</li><li><strong>Fix:</strong> Check the <a href="https://ai.google.dev/models" target="_blank" rel="noreferrer">Gemini Models list</a> and ensure the model name in <strong>Settings</strong> exactly matches a valid model ID.</li></ul><hr><h2 id="search-quality-issues" tabindex="-1">Search &amp; Quality Issues <a class="header-anchor" href="#search-quality-issues" aria-label="Permalink to &quot;Search &amp; Quality Issues&quot;">​</a></h2><h3 id="the-agent-says-it-can-t-find-information-but-i-know-i-have-a-note-on-it" tabindex="-1">&quot;The agent says it can&#39;t find information, but I know I have a note on it.&quot; <a class="header-anchor" href="#the-agent-says-it-can-t-find-information-but-i-know-i-have-a-note-on-it" aria-label="Permalink to &quot;&quot;The agent says it can&#39;t find information, but I know I have a note on it.&quot;&quot;">​</a></h3><ul><li><strong>Cause 1 (Search Strictness):</strong> The <strong>Minimum similarity score</strong> might be too high. <ul><li><strong>Fix:</strong> Lower it to <code>0.4</code> or <code>0.35</code> in Settings.</li></ul></li><li><strong>Cause 2 (Indexing):</strong> The note might not be indexed yet. <ul><li><strong>Fix:</strong> Toggle a small change in the note to force a re-index, or restart Obsidian to trigger a full vault scan.</li></ul></li></ul><h3 id="the-agent-answers-from-general-knowledge-not-my-notes" tabindex="-1">&quot;The agent answers from general knowledge, not my notes.&quot; <a class="header-anchor" href="#the-agent-answers-from-general-knowledge-not-my-notes" aria-label="Permalink to &quot;&quot;The agent answers from general knowledge, not my notes.&quot;&quot;">​</a></h3><ul><li><strong>Cause:</strong> The agent might feel &quot;confident&quot; enough to answer without checking your vault.</li><li><strong>Fix:</strong> Be explicit. Ask <em>&quot;Based on my notes...&quot;</em> or use the <code>@</code> mention feature to point it to specific folders.</li></ul><hr><h2 id="debugging" tabindex="-1">Debugging <a class="header-anchor" href="#debugging" aria-label="Permalink to &quot;Debugging&quot;">​</a></h2><p>If you are reporting a bug on GitHub, please provide logs:</p><ol><li>Go to <strong>Settings &gt; Advanced</strong>.</li><li>Set <strong>Log level</strong> to <code>Debug</code>.</li><li>Open the Developer Console (<code>Ctrl+Shift+I</code> on Windows/Linux, <code>Cmd+Opt+I</code> on Mac).</li><li>Perform the action that fails.</li><li>Copy the logs starting with <code>[VaultIntelligence]</code>.</li></ol>',18)])])}const m=o(i,[["render",s]]);export{c as __pageData,m as default};
